import React, {Component} from 'react';
import {Link, Route, BrowserRouter, HashRouter} from "react-router-dom";
import Login from './Login'
import './menubar_css.css'
class Menubar extends Component{
    render(){
      return(
        <>

        <div className="Wrapper">
        <a className="name" href="#"><h2>동아리 모두 모아</h2></a>
        <div className="login">
         <Login></Login>
        </div>
        </div>
        <HashRouter>
        this.newMethod()
      </HashRouter>
      </>
      );
      }

  newMethod() {
    return <Nav variant="pills" defaultActiveKey="/home">
      <Nav.Item>
        <Nav.Link href="/home">Active</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="/Search">Option 2</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="/Register">Option 2</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="/Mypage">Option 2</Nav.Link>
      </Nav.Item>
    </Nav>;
  }
    }

export default Menubar;
